import logo from "./Candela.jpeg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo mt-3" alt="logo" />
        <h1>Hello World!</h1>
        <p>I'm Candela</p>
      </header>
    </div>
  );
}

export default App;
